[DoctorAdventures] Missy Martinez (In the Line of Boner / 22.11.2012)

Missy Martinez's job as a wartime nurse is taking its toll on her physically, emotionally and sexually. What she Needs is a distraction; something to put her Mind at Ease, something to Relax her Body. Still, Johnny Sins' progression from Soldier to Patient to Passionate Lover Comes as a surprise, even to her. 

